import React, { useRef } from "react";
import Grid from "@material-ui/core/Grid";
import { makeStyles } from "@material-ui/core/styles";
import SaveIcon from "@material-ui/icons/Save";
import Container from "@material-ui/core/Container";
import Button from "@material-ui/core/Button";
import { useReactToPrint } from "react-to-print";
//import Table from "../components/Table/Table";
import ActiveChart from "../Chart/ActiveChart";
import ContentChart from "../Chart/ContentChart";
import SummaryChart from "../Chart/SummaryChart";

const useStyles = makeStyles((theme) => ({
  button: {
    margin: theme.spacing(1),
  },
}));

export default function Summary(props) {
  const classes = useStyles();
  const componentRef = useRef();
  const handlePrint = useReactToPrint({
    content: () => componentRef.current,
  });
  const { name, lastName, cardID, titles, age, gender, major, edu } = props;
  return (
    <Container maxWidth="sm" alignItems="center">
      <div>
        <Grid
          container
          direction="row"
          justify="center"
          alignItems="center"
          spacing={1}
        >
          <div className={classes.root}>
            <Grid
              container
              direction="row"
              justify="center"
              alignItems="center"
              spacing={1}
              ref={componentRef}
            >
              <Grid item md={12} xs={12}>
                <Grid>
                  <Container fixed alignItems="center">
                    <div alignItems="center">
                      <div className="title">
                        สรุปผลประเมินความสนใจที่มีต่อหน่วยงานราชการ
                      </div>
                      <h4>
                        ชื่อ {titles} {name} นามสกุล {lastName} {edu} {major}
                      </h4>
                      <h4>เลขบัตรประจำตัวประชาชน {cardID}</h4>
                    </div>

                    <div className="radar">
                      <h3>คะแนนดิบในมิติกิจกรรมการทำงาน</h3>
                      <ActiveChart />
                    </div>

                    <div className="radar">
                      <h3>คะแนนดิบในมิติบริบทการทำงาน</h3>
                      <ContentChart />
                    </div>

                    <div className="radar">
                      <h3>ผลการประเมินความสนใจของบุคคลที่มีต่อราชการไทย</h3>
                      <SummaryChart />
                    </div>
                  </Container>
                </Grid>
              </Grid>
            </Grid>
            <Grid container direction="row" spacing={1}>
              <Grid container spacing={4}>
                <Grid item xs={5}>
                  <Button
                    variant="contained"
                    color="secondary"
                    size="large"
                    className={classes.button}
                    startIcon={<SaveIcon />}
                    alignItems="left"
                    onClick={handlePrint}
                  >
                    Print
                  </Button>
                </Grid>
              </Grid>
            </Grid>
          </div>
        </Grid>
      </div>
    </Container>
  );
}
